import React from 'react';
import { Routes, Route, BrowserRouter } from 'react-router-dom'; // Added import for Routes and Route
import Navbar from './components/Navbar/navbar';
import Footer from './components/footer/footer';
import Home from './pages/home/home';
import Services from './pages/service/service'; // Changed 'Service' to 'Services' for consistency
function App() {
  return (
    <div className="App">
      <Navbar />

      <Footer/>

    </div>
  );
}
function Layout() {
  return (
    <div className="App">
      {/* <Navbar /> */}
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/service" element={<Services />} /> {/* Changed 'Services' component name */}
      </Routes>
      </BrowserRouter>
      {/* <Footer/> */}

    </div>
  );
}

export default App;
Layout(); // Fixed error: Call the Layout function to use it
